        width={1000}
        height={1000}
        viewBox="0 0 465 280"
        backgroundColor="#f3f3f3"
        foregroundColor="#ecebeb"
        {...props}
    >
        <circle cx="220" cy="243" r="131" />
        <rect x="68" y="394" rx="15" ry="15" width="310" height="35" />
        <rect x="68" y="447" rx="15" ry="15" width="310" height="102" />
        <rect x="255" y="570" rx="15" ry="15" width="115" height="45" />
        <rect x="75" y="573" rx="15" ry="15" width="98" height="37" />
    </ContentLoader>
)

export default Skeleton
